import React, {Component} from 'react';
import {Text, Alert} from 'react-native';

export default class Menu extends Component {
  constructor(props) {
    super(props);
    this.state = {
      datos: [],
    };
  }
  componentDidMount() {
    //Llamo a un metodo para traer todos los datos del expuesto
    Alert.alert(`Bienvenido ${this.props.nombre}`);
  }

  render() {
    const menuTitulo = 'ART Menu - Expuesto: ' + this.props.nombre;
    return (
      <>
        <Text>{menuTitulo}</Text>
        <Text>Datos</Text>
        <Text>Credencial</Text>
        <Text>Preguntas frecuentes</Text>
        <Text onPress={this.props.handleLogout}>Logout</Text>
      </>
    );
  }
}
